    public int arrayPairSum(int[] nums) {
        if (nums.length %2 !=0 && nums.length<=10000 && nums.length >=1){
            return 0;
        }
        nums = sortNums(nums);
        int sum = 0;
        int positive[] = new int[nums.length/2];
        int negative[] = new int[nums.length/2];
        int m = 0,n = 0;
        for (int i = 0; i< nums.length;i++){
            if(nums[i]>0){
                positive[m++] = nums[i];
            }else{
                negative[n++] = nums[i];
            }
        }
        for (int i =0; i< nums.length/2;i++){
            if(i%2==0){
                sum += negative[2*i];
            }else{
                int k = i /2;
                sum += positive[i];
            }
        }

        return sum;
    }

