    public int[] sortNums (int[] nums){
        int length = nums.length;
        for (int i = 0; i < length-1; i++){
            int temp = nums[i];
            for (int j = i+1; j < length; j++){
                if(temp > nums[j]){
                    nums[i] = nums[j];
                    nums[j] = temp;
                    temp = nums[i];
                }
            }
        }
        return nums;
    }


